\begin{cases}
2x-1 \geq 0 \\
2x-1 < \frac{1}{3}
\end{cases}

Solving this system of inequalities, we obtain $\frac{1}{2} \leq x < \frac{2}{3}$.

Therefore, the correct answer is D: $\boxed{\left[ \frac{1}{2}, \frac{2}{3} \right)}$.

