To find the maximum value of $\sqrt{m+1}+\sqrt{n+2}$ given that $m+n=5$ for positive numbers $m$ and $n$, we proceed as follows:

First, we square the expression to simplify our calculations:
\begin{align*}
(\sqrt{m+1}+\sqrt{n+2})^{2} &= (m+n+3) + 2\sqrt{(m+1)(n+2)} \\
&= 8 + 2\sqrt{(m+1)(n+2)}.
\end{align*}

Next, we apply the AM-GM inequality, which states that the arithmetic mean of non-negative real numbers is greater than or equal to the geometric mean of those numbers. Applying this to $\sqrt{m+1}$ and $\sqrt{n+2}$ gives:
\begin{align*}
\frac{(\sqrt{m+1})^{2} + (\sqrt{n+2})^{2}}{2} &\geq \sqrt{(\sqrt{m+1})^{2} \cdot (\sqrt{n+2})^{2}} \\
\frac{m+n+3}{2} &\geq \sqrt{(m+1)(n+2)}.
\end{align*}

Multiplying both sides by $2$ and rearranging, we get:
\begin{align*}
8 + 2\sqrt{(m+1)(n+2)} &\leq 8 + m + n + 3 \\
&= 16.
\end{align*}

Taking the square root of both sides of our initial squared expression and considering our derived inequality, we find:
\begin{align*}
\sqrt{m+1}+\sqrt{n+2} &\leq \sqrt{16} \\
&= 4.
\end{align*}

Equality holds when $\sqrt{m+1} = \sqrt{n+2}$, which, upon solving, gives $m = 3$ and $n = 2$. This satisfies the given condition $m+n=5$.

Therefore, the maximum value of $\sqrt{m+1}+\sqrt{n+2}$ is $\boxed{4}$, which corresponds to option $\boxed{D}$.

